n = int(input())
hashtags = [input() for i in range(n)]

def lex_compare(a,b):
    if a[0] != '#' and b[0] != '#':
        return -1
    if a[0] == '#' and b[0] == '#':
        if a == b:
            return 0
        if len(a) < len(b):
            return -1
        if len(a) > len(b):
            return 1
        for i in range(len(a)):
            if a[i] < b[i]:
                return -1
            if a[i] > b[i]:
                return 1
    if a[0] == '#' and b[0] != '#':
        return -1
    if a[0] != '#' and b[0] == '#':
        return 1

hashtags.sort(lex_compare)
for h in hashtags:
    print(h)
